import React, { Component } from 'react';
import { Route } from 'react-router-dom';
import Home from '../pages/Home';
import KonstituenIndex from '../pages/konstituen/Index';
import KonstituenCreate from '../pages/konstituen/Create';

const ContainerRoutes = () => {
   return (
      <div className = "container">
         <Route path = '/' exact component = { Home } />
         <Route path = '/konstituenIndex' component = { KonstituenIndex } />
         <Route path = '/konstituenCreate' component = { KonstituenCreate } />
      </div>
   )
}

export default ContainerRoutes;
